import React from 'react';
import Homepage from './Homepage';
import {Switch} from 'react-router-dom';

class App extends React.Component {

  render() {
    return (
      <Switch>
        <Route exact path = "/">
          <Homepage/>
        </Route>
        <Route>
          <div>Page not found!</div>
        </Route>
      </Switch>
    );
  }
}

export default App;
